erent behavior or design.'}, {'id': 2307405137, 'node_id': 'MDU6TGFiZWwyMzA3NDA1MTM3', 'url': 'https://api.github.com/repos/googleapis/google-api-java-client/labels/priority:%20p3', 'name': 'priority: p3', 'color': 'ffffc7', 'default': False, 'description': 'Desirable enhancement or fix. May not be included in next release.'}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 1, 'created_at': '2022-01-28T10:29:37Z', 'updated_at': '2022-03-24T23:10:52Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'The error response model of the GMB APIs ([https://developers.google.com/my-business/ref_overview](https://developers.google.com/my-business/ref_overview)) currently looks like this:

