The subclass [Details](https://github.com/googleapis/google-api-java-client/blob/ef26931d0b3392d7e4354d22d38c1f95fcd9c6a0/google-api-client/src/main/java/com/google/api/client/googleapis/json/GoogleJsonError.java#L187) of the [GoogleJsonError](https://github.com/googleapis/google-api-java-client/blob/main/google-api-client/src/main/java/com/google/api/client/googleapis/json/GoogleJsonError.java) class, however, does not feature an errorDetails property.
